import React from "react";
import './header.css';

function Header (){

    return(
        <div>
           
                <div className="name">GIOVANE MICOSSI</div>
            <nav>
                    <li>HOME</li>
                    <li>ABOUT ME</li>
                    <li>CONTACT</li>
                    <li>SERVICES</li>
            </nav>

        </div>
    )
}

export default Header
